import React from "react";

const tileData = [
  {
    id: 1,
    img: image5,
  },
  {
    id: 2,
    img: image2,
  },
  {
    img: image1,
    id: 3,
  },

  {
    img: image3,
    id: 4,
  },
  {
    img: image4,
    id: 5,
  },
];

const About = () => {
  return (
    <>
      <div className="gallery">
          {tileData.map((item, id) => {
              return(
                  <div className='pics' key={id}>
<img src={item.imgScr}/>
                  </div>
              )
          })}
     </div>;
    </>
  );
};

export default About;
